value.string:
/**\n
 * Jasmine matchers by Aaron Powell (https://github.com/aaronpowell)\n
 * Source: http://www.aaron-powell.com/posts/2011-12-23-useful-jasmine-extensions.html\n
 */\n
\n
beforeEach(function() {\n
  this.addMatchers({\n
    toBeInArray: function(arr) {\n
      return ~arr.indexOf(this.actual);\n
    },\n
    toBeInDateRange: function(min, max) {\n
      var actual = this.actual.getTime();\n
      return actual <= max.getTime() && actual >= min.getTime();\n
    },\n
    toBeInNumericalRange: function (min, max) {\n
      var actual = this.actual;\n
      return actual <= max && actual >= min;\n
    }\n
  });\n
});\n
